import { Link } from 'react-router-dom'

const Navbar = () => {
    return (
        <nav className="flex pl-2">
            <Link to ='/'>Home</Link>
            <Link to ='/'>About</Link>
            <Link to ='/'>Contact</Link>

        </nav>
    )
}

export default Navbar
